function ShoppingList(){
    function add(){
        console.log('Add clicked');
    }

    return (<div className="shopping">
        <h1>Your Shopping List:</h1>

        <div className="form">
            <label>Product</label>
            <input placeholder="Type a product to add to your list" type="text" />
            <button onClick={add} className="btn btn-warning"></button>
            Add
        </div>


    </div>
    


    );
}

export default ShoppingList;
